import React from 'react';
import Message from './Message';
import '../styles/chatbot.css';

const ChatBox = ({ messages }) => {
  return (
    <div className="chat-box">
      {messages.map((msg, i) => (
        <Message key={i} sender={msg.sender} text={msg.text} />
      ))}
    </div>
  );
};

export default ChatBox;
